import React from 'react'
import Header from './Header';
import Home from './Home';
import About  from './About';
import Footer from './Footer';
import CourseDetail from './CourseDetail';
import TeacherDetail from './TeacherDetail';

//Teacher
import TeacherRegister from './Teacher/TeacherRegister';
import TeacherLogin from './Teacher/TeacherLogin';
import TeacherDashboard from './Teacher/TeacherDashboard';
import TeacherCourses from './Teacher/TeacherCourses';
import TeacherProfileSetting from './Teacher/TeacherProfileSetting';
import TeacherChnagePassword from './Teacher/TeacherChangePassword';
import AddCourse from './Teacher/AddCourse';

//Student
import Register from './User/Register';
import Login from './User/Login';
import Dashboard from './User/Dashboard';

import MyCourses from './User/MyCourses';
import FavoriteCourses from './User/FavoriteCourses';
import RecommendedCourses from './User/RecommendedCourses';
import ProfileSetting from './User/ProfileSetting';
import ChnagePassword from './User/ChangePassword';

import {Routes as Switch,Route} from 'react-router-dom';
import UserList from './Teacher/UserList';



function Main() {
    return (
      <div className="App">
        <Header/>
        <Switch>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/detail/:course_id" element={<CourseDetail />} />
          <Route path="/teacher-details/:course_id" element={<CourseDetail />} />

          {/*Trainer */}
          <Route path="/teacher-login" element={<TeacherLogin />} />
          <Route path="/teacher-register" element={<TeacherRegister />} />
          <Route path="/teacher-dashboard" element={<TeacherDashboard />} />
          <Route path="/teacher-courses" element={<TeacherCourses />} />
          <Route path="/add-course" element={<AddCourse />} />
          <Route path="/teacher-users" element={<UserList />} />
          <Route path="/teacher-profile-setting" element={<TeacherProfileSetting />} />
          <Route path="/teacher-change-password" element={<TeacherChnagePassword />} />

          {/*Student */}
          <Route path="/user-login" element={<Login />} />
          <Route path="/user-register" element={<Register />} />
          <Route path="/user-dashboard" element={<Dashboard />} />
          <Route path="/my-courses" element={<MyCourses />} />
          <Route path="/favorite-courses" element={<FavoriteCourses />} />
          <Route path="/recommended-courses" element={<RecommendedCourses />} />
          <Route path="/profile-setting" element={<ProfileSetting />} />
          <Route path="/change-password" element={<ChnagePassword />} />





        </Switch>
        <Footer/>
      </div>
    );
  }

  export default Main;
